import React, { Component } from "react";

interface Props {
    email: string;
    firstname: string;
    lastname: string;
    age: number;    
};

interface State {
};


class PersonDescription extends Component<Props,State> {

    constructor(props : Props) {
        super(props);
    }
          
    render() {    
        return (
            <div >
                <p>{this.props.email} {this.props.firstname} {this.props.lastname}  {this.props.age}</p>
            </div>
        );
    }   
}

export default PersonDescription;
